import { FaGithub, FaLinkedin } from "react-icons/fa";
import "./ProfileStyles.css";
import { IconContext } from "react-icons"

function Profile() {
    return (
        <div id="info">
            <h1>Juan Aracena</h1>
            <div id="text">
                <h2>Software Developer</h2>
            </div>
            <img id="portrait" src="photo.jpg"></img>
            <IconContext.Provider value={{color: "black", className:"portraitColor"}}>
                <div id="icons">
                    <a href="https://github.com/JuanAracena"> <FaGithub size="4em"/></a>
                    <a href="https://www.linkedin.com/in/juan-aracena-santelises/"> <FaLinkedin size="4em"/></a>
                </div>
            </IconContext.Provider>
        </div>
    )
}

export default Profile;
